const Moves = (props) => {
    let o = {}


    const test = props.moves.reduce((total, currentValue) => {
        if(typeof total !== 'object'){
            total = {}
        }

        console.log(currentValue)
        currentValue.version_group_details.forEach(move => {
            const key = move.version_group.name
            const newObj = {
                move: currentValue.move.name,
                level: move.level_learned_at,
                method: move.move_learn_method.name,
                // mUrl: move.move_learn_method.url.match(/[0-9]+/),
                // vUrl: move.version_group
            }

            console.log(currentValue)
            console.log(move)

            if(typeof total[key] === 'undefined') {
                total[key] = []
                total[key].push(newObj)
            } else {
                total[key].push(newObj)
            }
        })

        return total
    })

    console.log(test)

    return (
        <div>

        </div>
    )
}

export default Moves
